export default {
  name: '',
  components: {},
  props: {
    listOne: {
      type: Array,
      default: []
    }
  },
  data: function data() {
    return {
      formValidate: {
        info: ''
      },
      isShow: false,
      loading: false,
      //选中信息集合
      selectEquips: [],
      columns1: [{
        type: 'selection',
        width: 60,
        align: 'center'
      }, {
        title: '信息',
        key: 'info'
      }, {
        title: '信息格式',
        key: 'label'
      }, {
        title: '提示信息',
        key: 'tip'
      }],
      listOneNew: []
    };
  },
  computed: {},
  watch: {
    listOne: {
      handler: function handler(n) {
        this.listOneNew = n;
      }
    }
  },
  created: function created() {},
  mounted: function mounted() {},
  methods: {
    handleSubmit: function handleSubmit() {
      var _this = this;

      if (this.formValidate.info) {
        var obj = [];
        this.listOne.forEach(function (item) {
          if (item.info.indexOf(_this.formValidate.info) != -1) {
            obj.push(item);
          }
        });
        this.$set(this, 'listOneNew', obj);
      } else {
        this.$set(this, 'listOneNew', this.listOne);
      }
    },
    selectionTap: function selectionTap(data) {
      this.selectEquips = data;
    },
    ok: function ok() {
      this.$emit('getInfoList', this.selectEquips);
      this.reset();
    },
    cancel: function cancel() {
      this.isShow = false;
      this.reset();
    },
    reset: function reset() {
      this.formValidate.info = '';
      this.$refs.table.selectAll(false);
      this.listOneNew = this.listOne;
    }
  }
};
